--
-- Name: signature_wastage(text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION signature_wastage(tbl text, col text) RETURNS real
    LANGUAGE plpgsql
    AS $$
DECLARE
  max REAL;
  count REAL;
BEGIN
  EXECUTE 'SELECT count(*) FROM ' || quote_ident(tbl)
          INTO count;
  EXECUTE 'SELECT max(' || quote_ident(col) || ') FROM ' || quote_ident(tbl)
          INTO max;
  RETURN 1.0 - (count / (COALESCE(max, 0) + 1));
END;
$$;


ALTER FUNCTION public.signature_wastage(tbl text, col text) OWNER TO postgres;

